import Login from "../Components/Login";
import Header from "./Header";




export default function Body (){
    return(
<>
<BrowserRouter>
<Header/>
<Switch>
<Route exact path="/"  component= {Home}/>
{/* <Route exact path="/tours/:detailId/detail/" component = {Lesson}/>
<Route exact path="/tourdetail/:tourdetailId/" component = {LessonDetail}/> */}
<Route exact path="/login" component = {Login}/>

<Route exact path="/courses/:courseId/lessons/" component = {Lesson}/>
<Route exact path="/lessons/:lessonId/" component = {LessonDetail}/>
</Switch>
</BrowserRouter>
</>
    )
}
